INSERT INTO `EmailVersions` VALUES (2,'nwl@microting.com;rm@microting.com','no-reply@microting.com','Opfølgning flydelag: G2: Flydelag; Farm 1','<!DOCTYPE html>\n<html>\n<head>\n	<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\"/>\n	<title></title>\n	<meta name=\"generator\" content=\"LibreOffice 7.3.6.2 (Linux)\"/>\n	<meta name=\"author\" content=\"Niels Windfeld-lund\"/>\n	<meta name=\"created\" content=\"2022-10-20T10:34:00\"/>\n	<meta name=\"changedby\" content=\"Niels Windfeld-lund\"/>\n	<meta name=\"changed\" content=\"2022-10-20T11:20:00\"/>\n	<meta name=\"AppVersion\" content=\"16.0000\"/>\n	<style type=\"text/css\">\n		@page { size: 8.27in 11.69in; margin-left: 0.79in; margin-right: 0.79in; margin-top: 1.18in; margin-bottom: 1.18in }\n		p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.1in; direction: ltr; background: transparent }\n	</style>\n</head>\n<body lang=\"da-DK\" link=\"#000080\" vlink=\"#800000\" dir=\"ltr\"><p style=\"line-height: 108%; margin-bottom: 0.11in\">\n<p style=\"line-height: 108%; margin-bottom: 0.11in\">Rapport sendt\nfra: Microting Opfølgning flydelag</p>\n<p style=\"line-height: 108%; margin-bottom: 0.11in\">Rapport\nfremsendt: 05-03-2023</p>\n<p style=\"line-height: 108%; margin-bottom: 0.11in\">Rapport gældende\nfor: Farm 1</p>\n<p style=\"line-height: 108%; margin-bottom: 0.11in\"><br/>\n<br/>\n\n</p>\n<table width=\"649\" cellpadding=\"7\" cellspacing=\"0\">\n	<col width=\"18\"/>\n\n	<col width=\"66\"/>\n\n	<col width=\"90\"/>\n\n	<col width=\"62\"/>\n\n	<col width=\"167\"/>\n\n	<col width=\"78\"/>\n\n	<col width=\"69\"/>\n\n	<tr valign=\"top\">\n		<td width=\"18\" bgcolor=\"#f4b083\" style=\"background: #f4b083; border: 1px solid #000000; padding: 0in 0.08in\"><p align=\"left\" style=\"orphans: 2; widows: 2\">\n			<span>Id</span></p>\n		</td>\n		<td width=\"66\" bgcolor=\"#f4b083\" style=\"background: #f4b083; border: 1px solid #000000; padding: 0in 0.08in\"><p align=\"left\"